public static Locale toLocale(final String str) {
    if (str == null) {
        return null;
    }
    final int len = str.length();
    if (len < 2) {
        throw new IllegalArgumentException("Invalid locale format: " + str);
    }
    if (str.charAt(1) != '_' && len < 5) {
        throw new IllegalArgumentException("Invalid locale format: " + str);
    }
    if (str.charAt(1) == '_' && len < 3) {
        throw new IllegalArgumentException("Invalid locale format: " + str);
    }
    if (!Character.isLowerCase(str.charAt(0))) {
        throw new IllegalArgumentException("Invalid locale format: " + str);
    }
    if (str.charAt(1) != '_' && !Character.isLowerCase(str.charAt(1))) {
        throw new IllegalArgumentException("Invalid locale format: " + str);
    }

    int index = 2;
    while (index < len && str.charAt(index) != '_' && Character.isUpperCase(str.charAt(index))) {
        index++;
    }

    if (index == len) {
        return new Locale(str.substring(0, 2));
    }

    if (str.charAt(index) != '_') {
        throw new IllegalArgumentException("Invalid locale format: " + str);
    }

    int index2 = index + 1;
    while (index2 < len && str.charAt(index2) != '_' && Character.isUpperCase(str.charAt(index2))) {
        index2++;
    }

    if (index2 == len) {
        return new Locale(str.substring(0, 2), str.substring(2, index));
    }

    if (str.charAt(index2) != '_') {
        throw new IllegalArgumentException("Invalid locale format: " + str);
    }

    return new Locale(str.substring(0, 2), str.substring(2, index), str.substring(index2 + 1));
}
